import React, { Component } from 'react'

class Form extends Component {
    constructor(props) {
        super(props)

        this.state = {
            email: "",
            password: "",
            topic: "React.sj"
        }
    }

    handleNameChange = (event) =>{
        this.setState({
            email : event.target.value
        })
    }

    render() {
        return (
            <form>
                <div>
                    <label>Email</label>
                    <input type='text' onChange = {this.handleNameChange}></input></div>
                <div>   <label>Password</label>
                    <textarea type='password'></textarea></div>
                <div>    <label>DropDown</label>
                </div>
            </form>
        )
    }
}

export default Form
